import React from 'react';

const fullpost=(props)=>{
    return(
        <div>
            <article className="Fullpost">
                <h1>{props.title}</h1>
                <div className="Info">
                    <div className="Author">{props.content}</div>
                </div>
            </article>
        </div>
    )
}

export default fullpost;
